def predict_voting_outcome(n, employees):
    r = employees.count('R')
    d = employees.count('D')
    i = j = 1
    while r > 0 and d > 0:
        while employees[j] == employees[i] or employees[j] == 'O':
            j = (j + 1) % n
        if employees[j] == 'R':
            r -= 1
        else:
            d -= 1
        employees = employees[:j] + 'O' + employees[j + 1:]
        c = i
        i = (i + 1) % n
        while employees[i] == 'O':
            i = (i + 1) % n
        if i < c:
            j = i = 0
            n = r + d
            new_employees = []
            for x in range(n):
                while employees[i] == 'O':
                    i += 1
                new_employees.append(employees[i])
                i += 1
            employees = ''.join(new_employees)
            i = j = 0
    if r > 0:
        return 'R'
    else:
        return 'D'

